I tried using the @types/weixin-app package and had problems.

  the formal parameter of the function wx.authorize is not options: AuthSetting
  the ShareMenuOptions is not the same as BaseOptions
  I tried to fix them like this:
interface AuthorizeOptions extends BaseOptions {
    scope: String;
  }
 function authorize(options: AuthorizeOptions): void;
 interface ShareMenuOptions extends BaseOptions {
    withShareTicket: boolean;
 }
and I have make a pull request

## Why?

Typescript requires assign of `navigation` on Component that is created with `withNavigation` HOC. But it comes with that function so it shouldn't require that property.

## Example

```typescript
//
// on the current version of Typed, this will give an error.
// with this PR, it will work.
//
interface IHelloProps extends Partial<NavigationInjectedProps> {
  hello: boolean;
}

const HelloBox: SFC<IHelloProps> = ({ navigation, hello }) => (
<View>
<TouchableHighlightCustom onPress={() => navigation.navigate('TEST', { hello })}>
        <Text>Hello</Text>
      </TouchableHighlightCustom>
</View>
);

export default withNavigation(HelloBox);
```
