TypeScript can't always infer subset types reliably, e.g. this won't work as expected. `OwnProps` will still include `InjectedProps`.
```typescript
type InjectedProps = {hello: 'world' };

function myHoc<OwnProps>(
  Component: ComponentType<OwnProps & InjectedProps>,
): ComponentType<OwnProps>;
```

To fix this, we need to compute `OwnProps` by manually subtracting `InjectedProps` from `InnerProps`, like this:
```typescript
type Omit<T, K extends keyof any> = Pick<T, Exclude<keyof T, K>>;

function myHoc<InnerProps extends InjectedProps>(
  Component: ComponentType<InnerProps>,
): ComponentType<Omit<InnerProps, keyof InjectedProps>>;
```

In addition, the actual instance type of the wrapped component can't be inferred with the current approach. By capturing the type of the component itself and using TypeScript 2.8's conditional types, we can infer the props of the captured component type, as well as its instance type:

```typescript
type InferProps<T extends ComponentType<any>> = T extends ComponentType<infer P> ? P : never;

function myHoc<T extends ComponentClass<InjectedProps>>(
  Component: T,
): ComponentType<Omit<InferProps<T>, keyof InjectedProps> & { onRef?: Ref<InstanceType<T>> }>;
```


